import React from "react";

const Dashboard = () => {
  return (
    <div style={{ width: "100vw", height: "100vh" }}>
      <iframe
        style="background: #21313C;border: none;border-radius: 2px;box-shadow: 0 2px 10px 0 rgba(70, 76, 79, .2);width: 100vw;height: 100vh;"
        src="https://charts.mongodb.com/charts-hslms-znydqqe/embed/dashboards?id=66fe559d-d09f-4bb0-8735-efa4e2f2cf11&theme=dark&autoRefresh=true&maxDataAge=3600&showTitleAndDesc=false&scalingWidth=scale&scalingHeight=scale"
      ></iframe>
    </div>
  );
};

export default Dashboard;
